import styled from "styled-components";
import Post from "./Post";

const TemplateBlock = styled.div`
  padding-top: 1.11rem;
  box-sizing: border-box;
  background: #010101;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-flow: row wrap;
`;

const PostTemplate = ({ shows }) => {
  console.log(shows);
  return (
    <TemplateBlock>
      {shows.map((show) => {
        const key = `${show.title}-${show.season}`; // create unique key prop value
        return <Post key={key} show={show} />;
      })}
    </TemplateBlock>
  );
};

export default PostTemplate;
